              "string" : " Katherine Hamnett  、Martin Guy  、Ten Big Boys       等流行品牌）\n\n最初Diesel的活力概念并不那么容易被接受， Diesel标志性的满是破洞、污渍、手工漂洗做旧的Dirty牛仔裤总是遭到顾客的质量投诉——他们误以为那是残次品。30年后，Diesel品牌成为最性感的象征，喜欢Diesel品牌的粉丝遍布全球。2008年，Diesel30周年时举办了全球17个城市二十四小时不间断Party的“Diesel xXx”主题大型活动，并推出  “Dirty Thirty”        限量版牛仔裤。如今，Diesel这个充满活力的品牌在全球有200多家店铺，年销售额约12亿美元。\n\nDiesel的风格年轻而富有创意，灵感都是来自于日常生活的点点滴滴，与潮流动向紧密不分。Diesel从一开始就没有放低身价，绝不讨好大多数，Diesel和Diesel的顾客之间形成了一种小众又自鸣得意的沟通，就像伦佐·罗索（Renzo Rosso）所说：“Diesel从不诱导顾客该买什么，而是传递一种对生活的感受，我相信顾客的智力， 他们也相信我。”\n\nDiesel是一个以鲜明的“D”字母而令人印象深刻的服装系列，主要是以牛仔材质设计男女服装。Diesel针对不同消费群体推出了不同的系列：\n\nDiesel Style Lab 系列则是以设计、布料和商品创意的高级休闲服装系列，针对追求新设计和喜爱穿着的消费群体。Diesel Kids 是针对少年儿童的系列服装。\n\nDiesel自1991年起，在每季的产品广告上都打出“For Successful Living”的标语，并且以故事形式来包装其服装系列，每季讲述一个故事。2002年，Diesel邀请时尚教父 Karl Lagerfeld合作推出 Lagerfeld Gallery by Diesel 牛仔系列，引领时尚界 crosscover 跨界合作之风。2003年，流行歌后小甜甜Britney Spears出席 Diesel Style Lab 系列服装发布会，成功提升带动 Diesel Style Lab 品牌形象。\n\nDiesel跨界合作“500 by Diesel”：Diesel与FIAT菲亚特500汽车跨界设计的时尚汽车款型，该车型由Diesel设计外观和内饰，将自2008年11月9日起在世界限量销售1万辆。\n\n品牌风格\nDiesel标志性的满是破洞、污渍、手工漂洗做旧的Dirty牛仔裤总是遭到顾客的质量投诉----他们误以为那是残次品。30年后，Diesel品牌成为最性感的象征，喜欢Diesel品牌的粉丝遍布全球。"
